// Function to encode a given string
string Huffman::encode(string str) {
    string encoded;
    for (int i = 0; i<str.length(); i += length) {
        string subStr = str.substr(i, length);
        stack<bool> huffmanCode = huffmanCodes[subStr];
        while(!huffmanCode.empty()){ 
            encoded += huffmanCode.top() ? '1' : '0';
            huffmanCode.pop();
        }
    }
    return encoded;
}

// Function to decode a given encoded string
string Huffman::decode(string binary) {
    string decoded;
    for (int i = 0; i < binary.size(); ++i) {
        for (int len = 1; i + len <= binary.size(); ++len) {
            string substr = binary.substr(i, len);
            auto it = code.find({substr.size(), stoi(substr, nullptr, 2)});
            if (it != code.end()) {
                decoded += it->second;
                i += len;
                break;
            }
            else if (substr.size() > 20) {
                cout << "Substring: " << substr << "Not found" << endl;
                break;
            }
        }
    }
    
    // TODO: Implement decoding logic here
    return decoded;
}
